.: Plot :. 

Jack, Brad Armstrong, decides to save money and look for a roommate, after his girlfriend, Asa Akira walks out on him. He's less than impressed by the selection of applicants, that is, until Ally, Kirsten Price shows up at the door. Ally is stunning, and his friends can't talk Jack into moving her in quick enough. That's when the fun begins. For everyone but Jack that is. He has a self-imposed no sex with Roommates policy, but Ally's making it very difficult to stick to. In the end, after she's had sex with half the neighborhood, Jack can't take it any more, and gives in. But by now, the quirky roomies have actually fallen in love with each other, and like any good Hollywood movie, Live Happily Ever After and have great sex!

